import React from "react";
import "./css/famHistory.css";
import manager from "../Images/aboutUs__banner.jpg";

const FamHistory = () => {
  return (
    <div className="famHistory">
      <div className="firstSection__container"></div>
      <div className="secondSection__container">
        <div className="manager__Image__container">
          <img src={manager} alt="" className="whoAreWe__Img" />
        </div>
      </div>
    </div>
  );
};

export default FamHistory;
